/********************************************************************************/
/*		m_calc																	*/
/********************************************************************************/
float m_calc(struct C *c1)
{
	return sqrt(c1->r*c1->r + c1->i*c1->i);
}
/********************************************************************************/
/*		m_getbuf																*/
/********************************************************************************/
void m_getbuf()
{
    int tmp;
//    volatile int i;
    
	PR3 = osci_v.m_PR3;
	TMR3 = 0;
//	IEC0bits.T3IE = 1;						// äÑÇËçûÇ›ãñâ¬ÅAîgå`èoóÕ
	DCH1CONbits.CHAEN = 0;					// channel automatic off
	DCH1DSA = ((uint32_t)osci_v.buf) & 0x1FFFFFFF;
	DCH1DSIZ = 4095*2;						// ëçì]ëóÉoÉCÉgêî
	DCH1INTbits.CHBCIF = 0;					// äÑÇËçûÇ›ÉtÉâÉOÉNÉäÉA
    tmp = 3*2;
	while(DCH2SPTR == tmp) ;
	while(DCH2SPTR != tmp) ;
 	DCH1CONbits.CHEN = 1;					// DMA start
	while(DCH1INTbits.CHBCIF==0)
		;
//	IEC0bits.T3IE = 0;						// äÑÇËçûÇ›ã÷é~ÅAîgå`í‚é~
}
