int m_freq_set()
{
	int cmd;
	
	lcd_clear(WHITE);
	back_color = BRUE;
	text_color = WHITE;
	lcd_cdisp_str_x2(4, "Max Frequency");
	back_color = WHITE;
	text_color = BLACK;
	cmd = menu_select(m_freq_menu);
	if(cmd==-1)							// exit sw
		return -1;
	osci_v.m_PR3 = m_PR3[cmd-1];
	osci_v.m_linear_footer = (char*)m_linear_footer[cmd-1];
	osci_v.m_log_footer = (char*)m_log_footer[cmd-1];
	PR3 = osci_v.m_PR3;
	return 0;
}
