/********************************************************************************/
void m_wave_form()
{
	float step;
	unsigned char high[251], low[251];
	
	lcd_clear(WHITE);
    sw_up();
	for(;;){
		PR3 = osci_v.m_PR3;
		TMR3 = 0;
		DCH1CONbits.CHAEN = 0;					// channel automatic off
		DCH1DSA = ((uint32_t)osci_v.buf) & 0x1FFFFFFF;
		DCH1DSIZ = 1001*2;					// ëçì]ëóÉoÉCÉgêî
		DCH1INTbits.CHBCIF = 0;				// äÑÇËçûÇ›ÉtÉâÉOÉNÉäÉA
		DCH1CONbits.CHEN = 1;				// DMA start
		while(DCH1INTbits.CHBCIF==0)
			;
		step = 0.25;
		graph_set((short*)osci_v.buf, step, high, low);
		graph_draw(high, low);
		if(sw_read()){
			sw_downup();
			return;
		}
	}
}
