/********************************************************************************/
/*		m_measure																*/
/********************************************************************************/
void m_measure()
{
	DCH2SSA = ((uint32_t) m_ushort)&0x1FFFFFFF;
	DCH2SSIZ = 4095*2;
	DCH2CONbits.CHEN = 1;			// DMA start
	if(m_freq_set() < 0){
		DCH2CONbits.CHEN = 0;
		return;
	}
	m_menu_set();
	DCH2CONbits.CHEN = 0;
}
